import React from 'react';
import './index.css';

const Paginate = ({bookList}) => {
    if (bookList.length) {
        console.log('paginate - ', Math.ceil(bookList.length/3))
        for (let pageIndex=1; pageIndex <= Math.ceil(bookList.length/3); pageIndex++) {
            return (
                <button className="page">{pageIndex}</button>
            )
        }
    } else {
        return null;
    }
}

export default Paginate;
